import styled from "styled-components";

export const HomeSection = styled.section`
  width: 100%;
  height: 160vh;
  background-color: ##205860;
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
  background-attachment: fixed;
  position: relative;
  display: flex;
`
